import { makeStyles } from '@material-ui/styles';

const styles = makeStyles(() => ({
  custoPorPecContainer: {
    paddingTop: '30px',
    paddingBottom: '50px'
  },
  tituloCustoPorPec: {
    fontSize: '20px',
    textAlign: 'center'
  },
  custoPorPec: {
    color: '#E35A50',
    fontSize: '36px',
    textAlign: 'center'
  },
  ultimasPecsTitulo: {
    background: '#8CBABE',
    color: 'white',
    fontSize: '21px',
    textAlign: 'center',
    padding: '5px 0px'
  },
  pec: {
    fontSize: '18px',
    border: '1px solid #CACACA',
    borderTop: 'none',
    padding: '12px',
    paddingLeft: '20px'
  }
}));

export default styles;
